import React, { useEffect, useState } from "react";
import axios from "axios";
import {
  MDBCard,
  MDBCardBody,
  MDBCardTitle,
  MDBCardText,
  MDBCardImage,
  MDBBtn,
  MDBCardHeader,
  MDBRipple,
  MDBRow,
  MDBCol,
} from "mdb-react-ui-kit";

function Book() {
  const [doctors, setDoctors] = useState([]);
  useEffect(() => {
    axios
      .get("/dataload")
      .then((response) => {
        setDoctors(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  }, []);
  return (
    <div className="App mt-4">
      <MDBRow>
        {doctors.map((doc) => (
          <MDBCol size="4" className="container" key={doc._id}>
              <MDBCard className="mb-2 mt-2">
                <MDBCardHeader>{doc.name}</MDBCardHeader>
                <MDBRipple
                  rippleColor="light"
                  rippleTag="div"
                  className="bg-image hover-overlay"
                >
                  {/* <MDBCardImage src="" fluid alt="..." />
                  <a>
                    <div
                      className="mask"
                      style={{ backgroundColor: "rgba(251, 251, 251, 0.15)" }}
                    ></div>
                  </a> */}
                </MDBRipple>
                <MDBCardBody>
                  <MDBCardTitle>{doc.catagory}</MDBCardTitle>
                  <MDBCardText>{doc.degree}</MDBCardText>
                  <MDBBtn href="/">Book Appointment</MDBBtn>
                </MDBCardBody>
              </MDBCard>
            </MDBCol>
        ))}
      </MDBRow>
    </div>
  );
}
export default Book;
